import React, {Component} from "react";

class App extends Component{
    constructor(){
        super()
        this.state = {
            isLoggedIn: false,
        }
    }

    render(){
        return(
            <div>
                <h1>
                    You are currently logged
                </h1>
                <h3>
                {this.setState.isLoggedIn ? "in" : "out"}
                </h3>
            </div>
        )
    }
}

export default App;
